	private static long[] computePawnAttackMoves(boolean isWhite) {
		long[] array = new long[64];
		
		for (int i = 0; i < 64; i++) {
			int ypos = i >>> 3;
			int xpos = i & 7;
			long moves = 0;
			
			if (isWhite) {
				if (ypos < 6) {
					if (xpos > 0) {
						moves |= 1L << (xpos - 1L + ((ypos + 1L) << 3L));
					}
					
					if (xpos < 7) {
						moves |= 1L << (xpos + 1L + ((ypos + 1L) << 3L));
					}
				}
			} else {
				if (ypos > 0) {
					if (xpos > 0) {
						moves |= 1L << (xpos - 1L + ((ypos - 1L) << 3L));
					}
					
					if (xpos < 7) {
						moves |= 1L << (xpos + 1L + ((ypos - 1L) << 3L));
					}
				}
			}
			
			array[i] = moves;
		}
		
		return array;
	}
	
	private static long[] computeKingMoves() {
		long[] array = new long[64];
		
		for (int i = 0; i < 64; i++) {
			int ypos = i >>> 3;
			int xpos = i & 7;
			long moves = 0;
			
			for (int j = 0; j < 9; j ++) {
				if (j == 4) {
					continue;
				}
				
				int xp = xpos + (j % 3) - 1;
				int yp = ypos + (j / 3) - 1;
				
				if (xp < 0 || xp > 7 || yp < 0 || yp > 7) {
					continue;
				}
				
				moves |= 1L << (xp + (yp << 3L));
			}
			
			array[i] = moves;
		}
		
		return array;
	}
	
	private static long[] computeKnightMoves() {
		long[] array = new long[64];
		int[] offsets = { -1, -2, 1, -2, 2, -1, 2, 1, 1, 2, -1, 2, -2, 1, -2, -1 };
		
		for (int i = 0; i < 64; i++) {
			int ypos = i >>> 3;
			int xpos = i & 7;
			long moves = 0;
			
			for (int j = 0; j < 16; j += 2) {
				int xp = xpos + offsets[j];
				int yp = ypos + offsets[j + 1];
				
				if (xp < 0 || xp > 7 || yp < 0 || yp > 7) {
					continue;
				}
				
				moves |= 1L << (xp + (yp << 3L));
			}
			
			array[i] = moves;
		}
		
		return array;
	}
	
	private static long[] computeBishopMoves() {
		long[] array = new long[64];
		
		for (int i = 0; i < 64; i++) {
			int ypos = i >> 3;
			int xpos = i & 7;
			long result = 0;
			
			for (int j = 0; j < 4; j++) {
				int dx = (j   & 1) * 2 - 1;
				int dy = (j >>> 1) * 2 - 1;
				
				for (int k = 1; k < 8; k++) {
					int xp = xpos + dx * k;
					int yp = ypos + dy * k;
					
					if (xp < 0 || xp > 7 || yp < 0 || yp > 7) {
						break;
					}
					
					final long mask = 1L << (xp + (yp << 3));
					result |= mask;
				}
			}
			
			array[i] = result;
		}
		
		return array;
	}
	
	private static long[] computeRookMoves() {
		long[] array = new long[64];
		
		for (int i = 0; i < 64; i++) {
			int ypos = i >> 3;
			int xpos = i & 7;
			
			long result = 0;
			// TODO: Precompute this somehow
			for (int j = 0; j < 4; j++) {
				int dr = 1 - (j & 2);
				int dx = ((j    ) & 1) * dr;
				int dy = ((j + 1) & 1) * dr;
				
				for (int k = 1; k < 8; k++) {
					int xp = xpos + dx * k;
					int yp = ypos + dy * k;
					
					if (xp < 0 || xp > 7 || yp < 0 || yp > 7) {
						break;
					}
					
					final long mask = 1L << (xp + (yp << 3));
					result |= mask;
				}
			}
			
			array[i] = result;
		}
		
		return array;
	}
	
	private static long[][] computeBishopShadowsMoves() {
		long[][] array = new long[64][64];
		
		for(int i = 0; i < 64; i++) {
			int ypos = i >> 3;
			int xpos = i & 7;
			for (int e = 0; e < 64; e++) {
				long pieceMask = 1L << e;
				long result = 0;
				
				for (int j = 0; j < 4; j++) {
					int dx = (j & 1) * 2 - 1;
					int dy = (j >>> 1) * 2 - 1;
					
					for (int k = 1; k < 8; k++) {
						int xp = xpos + dx * k;
						int yp = ypos + dy * k;
						
						if (xp < 0 || xp > 7 || yp < 0 || yp > 7) {
							break;
						}
						
						final long mask = 1L << (xp + (yp << 3));
						result |= mask;
						
						if ((mask & pieceMask) != 0) {
							break;
						}
					}
				}
				
				array[i][e] = result;
			}
		}
		
		return array;
	}
	
	private static String getLongString(String name, long[] array) {
		StringBuilder sb = new StringBuilder();
		sb.append("public static final long[] ").append(name).append(" = {");
		for (int i = 0; i < array.length; i++) {
			if ((i & 3) == 0) {
				sb.append("\n\t");
			} else {
				sb.append(" ");
			}
			
			sb.append("0x%016xL,".formatted(array[i]));
		}
		
		return sb.append("\n};").toString();
	}
	
	private static String getLongLongString(String name, long[][] array) {
		StringBuilder sb = new StringBuilder();
		sb.append("public static final long[][] ").append(name).append(" = {");
		for (long[] arr : array) {
			sb.append("\n\t{");
			for (int j = 0; j < arr.length; j++) {
				if (j != 0) {
					sb.append(",");
				}
				sb.append("0x%016xL".formatted(arr[j]));
			}
			
			sb.append("},");
		}
		
		return sb.append("\n};").toString();
	}
	
